import React from "react";
import Carousel from "react-bootstrap/Carousel";


const CarouselItemBrand = (props) => {
    return (
        <Carousel.Item>
            <img
                className="d-block w-100"
                src={props.src}
                alt={props.src}
            />
            <Carousel.Caption>
                <h3>{props.title}</h3>
                <p>{props.detail}</p>
            </Carousel.Caption>
        </Carousel.Item>
    );
};


export default CarouselItemBrand;
